INSERT INTO `siteblocks_settings` VALUES (1,'РќРѕРјРµСЂ С‚РµР»РµС„РѕРЅР° РґР»СЏ РѕС‚РѕР±СЂР°Р¶РµРЅРёРµ РЅР° СЃР°Р№С‚Рµ','phonenum','+7 945 785-32-11','input'),(2,'РЎР»СѓР¶РµР±РЅС‹Р№ РїРѕС‡С‚РѕРІС‹Р№ СЏС‰РёРє','workemail','store@slon-drakon.ru','input'),(3,'РўРµРєСЃС‚ РїСЂРѕ РґРѕСЃС‚Р°РІРєСѓ','delivery_text','\r\n								<h1>Р”РѕСЃС‚Р°РІРєР°</h1>\r\n								<h2>РљСѓСЂСЊРµСЂСЃРєР°СЏ РґРѕСЃС‚Р°РІРєР°</h2>\r\n								<p>РљСѓСЂСЊРµСЂСЃРєР°СЏ РґРѕСЃС‚Р°РІРєР° РїРѕ РџРёС‚РµСЂСѓ. Р’РѕР·РјРѕР¶РЅР° РґР°Р¶Рµ РІ РґРµРЅСЊ Р·Р°РєР°Р·Р°</p>\r\n								<h2>EMS РџРѕС‡С‚Р° Р РѕСЃСЃРёРё</h2>\r\n								<p>РњС‹ РјРѕР¶РµРј РѕС‚РїСЂР°РІРёС‚СЊ Р·Р°РєР°Р· РєСѓСЂСЊРµСЂСЃРєРѕР№ СЌРєСЃРїСЂРµСЃСЃ-РґРѕСЃС‚Р°РІРєРѕР№ EMS РџРѕС‡С‚Р° Р РѕСЃСЃРёРё, РєРѕС‚РѕСЂР°СЏ РґРѕСЃС‚Р°РІРёС‚ РІР°С€ Р·Р°РєР°Р· РІ СЃР°РјС‹Рµ РєРѕСЂРѕС‚РєРёРµ СЃСЂРѕРєРё РїРѕ РІСЃРµР№ Р РѕСЃСЃРёРё (2-5 РґРЅСЏ РІ С†РµРЅС‚СЂР°Р»СЊРЅС‹Рµ РіРѕСЂРѕРґР° РѕР±Р»Р°СЃС‚Рё, 3-8 РґРЅРµР№ РІ РѕСЃС‚Р°Р»СЊРЅС‹Рµ РіРѕСЂРѕРґР°).</p>\r\n								<p><i>РћР±СЂР°С‰Р°РµРј Р’Р°С€Рµ РІРЅРёРјР°РЅРёРµ РЅР° РІРѕР·РјРѕР¶РЅРѕРµ СѓРІРµР»РёС‡РµРЅРёРµ СЃСЂРѕРєРѕРІ РґРѕСЃС‚Р°РІРєРё РїРѕ РЅРµ Р·Р°РІРёСЃСЏС‰РёРј РѕС‚ РЅР°СЃ РїСЂРёС‡РёРЅР°Рј.</i></p>\r\n							','redactor'),(4,'РўРµРєСЃС‚ РїСЂРѕ РѕРїР»Р°С‚Сѓ','payment_text','<h1>РћРїР»Р°С‚Р°</h1>\r\n<h2>РќР°Р»РёС‡РЅС‹РјРё РєСѓСЂСЊРµСЂСѓ</h2>\r\n\r\n<p>РџСЂРё РїРѕР»СѓС‡РµРЅРёРё Р·Р°РєР°Р·Р°, Р’С‹ РѕРїР»Р°С‡РёРІР°РµС‚Рµ РµРіРѕ РЅР°Р»РёС‡РЅС‹РјРё РєСѓСЂСЊРµСЂСѓ.</p>\r\n<h2>РќР°Р»РѕР¶РµРЅРЅС‹Р№ РїР»Р°С‚РµР¶</h2>\r\n\r\n<p>РџСЂРё РїРѕР»СѓС‡РµРЅРёРё РїРѕСЃС‹Р»РєРё, Р’С‹ РѕРїР»Р°С‡РёРІР°РµС‚Рµ Р·Р°РєР°Р· РЅР° РџРѕС‡С‚Рµ.</p>\r\n<h2>РћРЅР»Р°Р№РЅ РїР»Р°С‚РµР¶Рё</h2>\r\n\r\n<p>РњС‹ РїСЂРёРЅРёРјР°РµРј Р±Р°РЅРєРѕРІСЃРєРёРµ РєР°СЂС‚С‹.</p>\r\n\r\n<p><img src=\"/media/images/visa.png\" alt=\"\"></p>','redactor'),(5,'РўРµРєСЃС‚ РїСЂРѕ РІРѕР·РІСЂР°С‚ С‚РѕРІР°СЂР°','return_text','\r\n								<h1>Р’РѕР·РІСЂР°С‚ С‚РѕРІР°СЂР°</h1>\r\n								<p>Р’ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ РџРѕСЃС‚Р°РЅРѕРІР»РµРЅРёРµРј РџСЂР°РІРёС‚РµР»СЊСЃС‚РІР° Р РѕСЃСЃРёР№СЃРєРѕР№ Р¤РµРґРµСЂР°С†РёРё РѕС‚ 27 СЃРµРЅС‚СЏР±СЂСЏ 2007 Рі. в„– 612 В«РћР± СѓС‚РІРµСЂР¶РґРµРЅРёРё РїСЂР°РІРёР» РїСЂРѕРґР°Р¶Рё С‚РѕРІР°СЂРѕРІ РґРёСЃС‚Р°РЅС†РёРѕРЅРЅС‹Рј СЃРїРѕСЃРѕР±РѕРјВ», РґРѕРІРѕРґРёРј РґРѕ Р’Р°С€РµРіРѕ СЃРІРµРґРµРЅРёСЏ, С‡С‚Рѕ РџРѕРєСѓРїР°С‚РµР»СЊ РІРїСЂР°РІРµ РѕС‚РєР°Р·Р°С‚СЊСЃСЏ РѕС‚ С‚РѕРІР°СЂР° РІ Р»СЋР±РѕРµ РІСЂРµРјСЏ РґРѕ РµРіРѕ РїРµСЂРµРґР°С‡Рё, Р° РїРѕСЃР»Рµ РїРµСЂРµРґР°С‡Рё С‚РѕРІР°СЂР° вЂ” РІ С‚РµС‡РµРЅРёРµ 7 РґРЅРµР№.</p>\r\n								<p>Р’РѕР·РІСЂР°С‚ РѕСЃСѓС‰РµСЃС‚РІР»СЏРµС‚СЃСЏ РїРѕ Р°РґСЂРµСЃСѓ: РџСѓР»РєРѕРІСЃРєРѕРµ С€РѕСЃСЃРµ, 25, РєРѕСЂРї. 1, Р»РёС‚. Рђ</p>\r\n					','redactor'),(6,'РљРѕРЅС‚Р°РєС‚С‹','contacts','<h1><a href=\"#accord1\" class=\"accord-lnk current\">РљРѕРЅС‚Р°РєС‚С‹</a></h1>\r\n								<div id=\"accord1\" class=\"accord\" style=\"display: block;\">\r\n									<h2>РњР°РіР°Р·РёРЅ РІ РўР¦ В«Р›РµС‚РѕВ»</h2>\r\n									<div class=\"map-mark\"></div>\r\n									<div class=\"map-des\">\r\n										<a href=\"#\">РџСѓР»РєРѕРІСЃРєРѕРµ С€РѕСЃСЃРµ, 25, РєРѕСЂРї. 1, Р»РёС‚. Рђ</a>\r\n										<div><i>СЃ 10 РґРѕ 19 С‡Р°СЃРѕРІ</i></div>\r\n									</div>\r\n									<h2>+7 495 785-32-11</h2>\r\n									<a href=\"mailto:store@slon-drakon.ru\">store@slon-drakon.ru</a>\r\n								</div>\r\n								<h1><a href=\"#accord2\" class=\"accord-lnk\">РћРїС‚РѕРІС‹Рµ РїСЂРѕРґР°Р¶Рё</a></h1>\r\n								<div id=\"accord2\" class=\"accord\">\r\n									<p>Р’ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ РџРѕСЃС‚Р°РЅРѕРІР»РµРЅРёРµРј РџСЂР°РІРёС‚РµР»СЊСЃС‚РІР° Р РѕСЃСЃРёР№СЃРєРѕР№ Р¤РµРґРµСЂР°С†РёРё РѕС‚ 27 СЃРµРЅС‚СЏР±СЂСЏ 2007 Рі. в„– 612 В«РћР± СѓС‚РІРµСЂР¶РґРµРЅРёРё РїСЂР°РІРёР» РїСЂРѕРґР°Р¶Рё С‚РѕРІР°СЂРѕРІ РґРёСЃС‚Р°РЅС†РёРѕРЅРЅС‹Рј СЃРїРѕСЃРѕР±РѕРјВ», РґРѕРІРѕРґРёРј РґРѕ Р’Р°С€РµРіРѕ СЃРІРµРґРµРЅРёСЏ, С‡С‚Рѕ РџРѕРєСѓРїР°С‚РµР»СЊ РІРїСЂР°РІРµ РѕС‚РєР°Р·Р°С‚СЊСЃСЏ РѕС‚ С‚РѕРІР°СЂР° РІ Р»СЋР±РѕРµ РІСЂРµРјСЏ РґРѕ РµРіРѕ РїРµСЂРµРґР°С‡Рё, Р° РїРѕСЃР»Рµ РїРµСЂРµРґР°С‡Рё С‚РѕРІР°СЂР° вЂ” РІ С‚РµС‡РµРЅРёРµ 7 РґРЅРµР№.</p>\r\n									<p>Р’РѕР·РІСЂР°С‚ РѕСЃСѓС‰РµСЃС‚РІР»СЏРµС‚СЃСЏ РїРѕ Р°РґСЂРµСЃСѓ: РџСѓР»РєРѕРІСЃРєРѕРµ С€РѕСЃСЃРµ, 25, РєРѕСЂРї. 1, Р»РёС‚. Рђ</p>\r\n								</div>\r\n								<h1><a href=\"#accord3\" class=\"accord-lnk\">РЎРѕС‚СЂСѓРґРЅРёС‡РµСЃС‚РІРѕ</a></h1>\r\n								<div id=\"accord3\" class=\"accord\">\r\n									<p>Р’ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ РџРѕСЃС‚Р°РЅРѕРІР»РµРЅРёРµРј РџСЂР°РІРёС‚РµР»СЊСЃС‚РІР° Р РѕСЃСЃРёР№СЃРєРѕР№ Р¤РµРґРµСЂР°С†РёРё РѕС‚ 27 СЃРµРЅС‚СЏР±СЂСЏ 2007 Рі. в„– 612 В«РћР± СѓС‚РІРµСЂР¶РґРµРЅРёРё РїСЂР°РІРёР» РїСЂРѕРґР°Р¶Рё С‚РѕРІР°СЂРѕРІ РґРёСЃС‚Р°РЅС†РёРѕРЅРЅС‹Рј СЃРїРѕСЃРѕР±РѕРјВ», РґРѕРІРѕРґРёРј РґРѕ Р’Р°С€РµРіРѕ СЃРІРµРґРµРЅРёСЏ, С‡С‚Рѕ РџРѕРєСѓРїР°С‚РµР»СЊ РІРїСЂР°РІРµ РѕС‚РєР°Р·Р°С‚СЊСЃСЏ РѕС‚ С‚РѕРІР°СЂР° РІ Р»СЋР±РѕРµ РІСЂРµРјСЏ РґРѕ РµРіРѕ РїРµСЂРµРґР°С‡Рё, Р° РїРѕСЃР»Рµ РїРµСЂРµРґР°С‡Рё С‚РѕРІР°СЂР° вЂ” РІ С‚РµС‡РµРЅРёРµ 7 РґРЅРµР№.</p>\r\n									<p>Р’РѕР·РІСЂР°С‚ РѕСЃСѓС‰РµСЃС‚РІР»СЏРµС‚СЃСЏ РїРѕ Р°РґСЂРµСЃСѓ: РџСѓР»РєРѕРІСЃРєРѕРµ С€РѕСЃСЃРµ, 25, РєРѕСЂРї. 1, Р»РёС‚. Рђ</p>\r\n								</div>\r\n								<h1><a href=\"#accord4\" class=\"accord-lnk\">Р’Р°РєР°РЅСЃРёРё</a><span class=\"worker\">2 СЂР°Р±РѕС‚РЅРёРєР°</span></h1>\r\n								<div id=\"accord4\" class=\"accord\">\r\n									<p>Р’ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ РџРѕСЃС‚Р°РЅРѕРІР»РµРЅРёРµРј РџСЂР°РІРёС‚РµР»СЊСЃС‚РІР° Р РѕСЃСЃРёР№СЃРєРѕР№ Р¤РµРґРµСЂР°С†РёРё РѕС‚ 27 СЃРµРЅС‚СЏР±СЂСЏ 2007 Рі. в„– 612 В«РћР± СѓС‚РІРµСЂР¶РґРµРЅРёРё РїСЂР°РІРёР» РїСЂРѕРґР°Р¶Рё С‚РѕРІР°СЂРѕРІ РґРёСЃС‚Р°РЅС†РёРѕРЅРЅС‹Рј СЃРїРѕСЃРѕР±РѕРјВ», РґРѕРІРѕРґРёРј РґРѕ Р’Р°С€РµРіРѕ СЃРІРµРґРµРЅРёСЏ, С‡С‚Рѕ РџРѕРєСѓРїР°С‚РµР»СЊ РІРїСЂР°РІРµ РѕС‚РєР°Р·Р°С‚СЊСЃСЏ РѕС‚ С‚РѕРІР°СЂР° РІ Р»СЋР±РѕРµ РІСЂРµРјСЏ РґРѕ РµРіРѕ РїРµСЂРµРґР°С‡Рё, Р° РїРѕСЃР»Рµ РїРµСЂРµРґР°С‡Рё С‚РѕРІР°СЂР° вЂ” РІ С‚РµС‡РµРЅРёРµ 7 РґРЅРµР№.</p>\r\n									<p>Р’РѕР·РІСЂР°С‚ РѕСЃСѓС‰РµСЃС‚РІР»СЏРµС‚СЃСЏ РїРѕ Р°РґСЂРµСЃСѓ: РџСѓР»РєРѕРІСЃРєРѕРµ С€РѕСЃСЃРµ, 25, РєРѕСЂРї. 1, Р»РёС‚. Рђ</p>\r\n								</div>\r\n','redactor'),(7,'РўРµРєСЃС‚ РїСЂРѕ РЎР°РјРѕРІС‹РІРѕР·','selfcarting_text'